<h3 class="wp-block-heading margin-bottom-half" style="font-size:clamp(21.536px, 1.346rem + ((1vw - 3.2px) * 1.53), 35px);px;line-height:1.26">GFX</h3>



<p class="margin-top-half" style="font-size:clamp(14px, 0.875rem + ((1vw - 3.2px) * 0.341), 17px);px;line-height:1.65">GFX merupakan singkatan dari Grafix atau Graphic. Atau definisinya: Genigraphics Graphics Link presentation. Graphic adalah sebuah karya seni. Mulai dari Lukisan, Menggambar sampai Photography juga merupakan bagian dari Graphic. Ada juga yang seni yang dibuat oleh computer. Dan itulah Grafix atau singkatnya GFX. GFX yang forum ini fokuskan adalah dalam bidang Forum Signature atau Artwork.(penjelasan mengenai Artwork dan Forum Signature silakan googling sendiri.)</p>



